script: |
  super -f text -I q1331.spq | sort > q1331.out

inputs:
  - name: q1331.spq
    data: |
      SELECT ALL + COUNT ( * ) + + + ( + COUNT ( * ) ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN - - CAST ( NULL AS INTEGER ) AND + + col1 * - 63;
  - name: tab0

outputs:
  - name: q1331.out
    data: |
      6
